    function loadMarketList(state, cityClass) {
    	var dataObj = { "stateCode": state };
    	reqUrl = "/services/lookups.asmx/GetMarkets";

    	$j.ajax({
    		type: "POST",
    		data: JSON.stringify(dataObj),
    		url: reqUrl,
    		contentType: "application/json; charset=utf-8",
    		dataType: "json",
    		success: function (data, textStatus) {
    			var markets = JSON.parse(data.d);
    			$j(cityClass).html('');
    			for (var i = 0; i < markets.length; i++) {
    				var market = markets[i];
    				$j(cityClass).append('<option value="' + market.MarketCode + '">' + market.MarketName + '</option>');
    			}
    			$j(cityClass).removeAttr('disabled')
    		},
    		error: function (data, textStatus) {
    			return false;
    		}
    	});
    }

    function getmarketINHC() {
    	var ddl = document.getElementById("content_2_inhc_0_ddlCity");
    	var dataObj = { "marketCode": ddl.value };
    	reqUrl = "/services/lookups.asmx/getMarketINHCLink";

    	$j.ajax({
    		type: "POST",
    		data: JSON.stringify(dataObj),
    		url: reqUrl,
    		contentType: "application/json; charset=utf-8",
    		dataType: "json",
    		success: function (data, textStatus) {
    			selectedINHC = data.d;
    			return true;
    		},
    		error: function (data, textStatus) {
    			return false;
    		}
    	});
    }

    var sendVarsOnClick = function () {
    	var ddl = document.getElementById("content_2_inhc_0_ddlChatCity");
    	var ddlState = document.getElementById("content_2_inhc_0_ddlChatState");
    	var lpunitS = _LP_CFG_.options["skill"];
    	// Push to queue
    	lpTag.vars.push([
          { scope: 'session', name: 'lpunitS', value: lpunitS },
          { scope: 'session', name: 'StateS', value: ddlState.value },
          //{ scope:'visitor', name:'ONCLICK_VISITOR_VARIABLE_NAME', value:'' }
    	]);
    	// This 'try' block is here because the LP code must be instantiated on the page
    	// before the lpTag.vars.send() method can be called
    	// If the method fails for this reason the variables in the queue will be picked
    	// up when the LP code initiates
    	try {
    		// Send waiting variables immediately
    		lpTag.vars.send();
    	} catch (e) { }
    };

    function getChatNowUrl() {
    	var ddl = document.getElementById("content_2_inhc_0_ddlChatCity");
    	var ddlState = document.getElementById("content_2_inhc_0_ddlChatState");
    	var dataObj = { "marketCode": ddl.value };
    	var arrLPvars = [];
    	_LP_CFG_.options["skill"] = "False" == "True" ? "mobile_" + ddl.value : ddl.value;
        arrLPvars.push({ scope: 'page', name: 'lpunit', value: _LP_CFG_.options["skill"] });
        arrLPvars.push({ scope: 'page', name: 'State', value: ddlState.value });
        arrLPvars.push({ scope: 'session', name: 'lpunitS', value: _LP_CFG_.options["skill"] });
        arrLPvars.push({ scope: 'session', name: 'StateS', value: ddlState.value });
        lpTag.vars.push(arrLPvars);
		try {
			// Send waiting variables immediately
			lpTag.vars.send();
		} catch (e) { }
        reqUrl = "/services/lookups.asmx/getChatNowLink";

        $j.ajax({
        	type: "POST",
        	data: JSON.stringify(dataObj),
        	url: reqUrl,
        	contentType: "application/json; charset=utf-8",
        	dataType: "json",
        	success: function (data, textStatus) {
        		chatUrl = data.d;
        		return true;
        	},
        	error: function (data, textStatus) {
        		return false;
        	}
        });
	}

	function getgoing() {
		if (selectedINHC.length > 0)
			top.location = selectedINHC;
	}

	var chatUrl = "";
	function openChat() {
		if (chatUrl.length > 0)
			window.open(chatUrl);
	}
</script>
