			<script type="text/javascript">var latitude = parseFloat('47.792053');
    var longitude = parseFloat('-122.183122');
    var communityName = "The Reserve at Canyon Park";
    var CommunityID = '2052'
    var CommunityAddress = "3627 228th St SE, Bothell, WA, 98021";
    var PrintPrevUrl = '/New-Homes/Washington/Seattle/Bothell/The-Reserve-at-Canyon-Park/printdynamicdirections';

    var DynamicMapping = 'True';
    var IsValidLocation = 'True';

    var IsMPC = 'False';

    // New used to store
    var curLatitude = 0;
    var curLongitude = 0;

    $j(document).ready(function () {

        // Set default value to Print URL
        if (PrintPrevUrl == undefined)
            PrintPrevUrl == '';

        // Set position on map
        CreateGeolocationMap('geolocation-map-canvas', latitude, longitude, CommunityID, communityName, IsMPC);

        // Load combos
        LoadComboProviders();

        // Get the current position
        //getLocation();

    });

    // Get current position
    function getLocation() {

        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(setPosition);
        } else {
            alert("Geolocation is not supported by this browser.");
        }
    }

    // Set position tos vars
    function setPosition(position) {

        curLatitude = position.coords.latitude;
        curLongitude = position.coords.longitude;

    }

    // Load combo with providers defined on XML
    function LoadComboProviders() {

        // Execute function
        $j.ajax({
            type: "POST",
            data: "{}",
            url: "/Services/Rest/SearchMethods.svc/getCarriers",
            contentType: "application/json; charset=utf-8",
            dataType: "json",
            success: function (e) { addItemsToCombo(e) }
        })

    }

    // Add items to combo
    function addItemsToCombo(e) {

        var arr = e;
        var len = arr.length;

        for (i = 0; i < len; i++) {

            var x = document.getElementById("cbo_Provider");

            var option = document.createElement("option");

            option.text = arr[i].DisplayName;

            option.value = arr[i].EmailMask;

            x.add(option);

        }

    }

    // Send location to mobile
    function OnClickSendLocation() {

        // Selected option validation
        var selectedProvider = document.getElementById("cbo_Provider").value;
        var typedNumber = document.getElementById("phone1").value;

        // Provider validation
        if (selectedProvider == '-1') {

            // Show styled alert
            confirmationSMS('SELPROVIDER');

            return;

        }
        else {

            document.getElementById('pProvider').style.color = 'white';

        }

        // Typed number validation
        if (typedNumber == '') {

            // Show styled alert
            confirmationSMS('TYPENUMBER');

            return;

        }
        else {

            document.getElementById('pNumber').style.color = 'white';

        }
                
        // Get current location (Lat,Long)
        //getLocation();

        // Build new URL
        var newURL = 'https://www.google.com/maps/dir/Current+Location/' + latitude + ',' + longitude;

        // Build google url
        $j.ajax({
            type: "POST",
            data: "{'longUrl':'" + newURL + "'}",
            url: "/Services/SearchMethods.asmx/getShortURL",
            contentType: "application/json; charset=utf-8",
            dataType: "json",
            success: function (e) { sendMessage(e.d, $j('#phone1').val(), selectedProvider) }
        })
    }

    // send message
    function sendMessage(ShortUrl, PhoneNumber, EmailMask) {

        // Build google url
        $j.ajax({
            type: "POST",
            data: "{'Coummunity':'" + communityName + "', 'Number':'" + PhoneNumber + "', 'GoogleURL':'" + ShortUrl + "', 'EmailMask':'" + EmailMask + "'}",
            url: "/Services/SearchMethods.asmx/sendSMS",
            contentType: "application/json; charset=utf-8",
            dataType: "json",
            success: function (e) { confirmationSMS(e.d) }
        })

    }
    
    // show error or confirmation message
    function confirmationSMS(Message) {

        if (Message == 'SELPROVIDER') {

            
            document.getElementById('pProvider').style.color = 'red';

            document.getElementById("cbo_Provider").focus();

        }
        else if (Message == 'TYPENUMBER') {

            document.getElementById('pNumber').style.color = 'red';

            document.getElementById("phone1").focus();

        }
        else if (Message == 'ERROR') {

            // Selected option validation
            document.getElementById("cbo_Provider").value = -1;
            document.getElementById("phone1").value = '';

            document.getElementById('divSelect').style.display = 'none';
            document.getElementById('divConfirmation').style.display = 'block';

            document.getElementById("lblMessage").innerHTML = 'Unsent message';

        }
        else if (Message == 'COMPLETE') {

            // Selected option validation
            document.getElementById("cbo_Provider").value = -1;
            document.getElementById("phone1").value = '';

            document.getElementById('divSelect').style.display = 'none';
            document.getElementById('divConfirmation').style.display = 'block';

            document.getElementById("lblMessage").innerHTML = 'Message sent succesfully';

        }

    }

    // Enables controls
    function OnClickSendNew() {

        document.getElementById("cbo_Provider").value = -1;
        document.getElementById("phone1").value = '';

        document.getElementById('divSelect').style.display = 'block';
        document.getElementById('divConfirmation').style.display = 'none';

    }



</script>
