    function PerformSearchResults(e) {
        if (e.which == 13 || e.keyCode == 13) {
            window.location.href = "/Search-Results?ss=" + $j('#txtHeaderSearch').val();
            return false;
        }
    }

    function lnkLogin_Click() {
        if ($j("a[name=lnkLogin]").text() != "Logout") {
            $j("a[name=lnkLogin]").toggleClass("loginClicked");
            if (!$j(".nav-acct").is(":visible")) {
                $j(".nav-acct").fadeIn(400);
                $j(".nav-login").fadeIn(400);
                $j("#txtUserName").focus();
            } else {
                $j(".nav-acct").fadeOut(400);
                $j(".nav-login").fadeOut(400);
                $j(".nav-forgot").fadeOut(400);
                $j(".nav-thanks").fadeOut(400);
            }
        } else {
            Lennar.Global.logoutUser();
            return false;
        }
    }

    function ForgotPassword() {
        $j(".nav-login").hide();
        $j(".nav-forgot").show();
