	function Tracking() {
		document.getElementsByClassName('frmEPTrackingINHC').src = "/ErwinPenlandTracking.aspx?page=CLICKTOCALL&vendor=ATLAS&division=SEALEN";
    }
    function MeetINHCClick(e) {
    	if ($j('.contact-item').parent().hasClass('list-view')) {
    		if ($j(e).attr('data-href')) {
    			$j.colorbox({ "open": true, closeButton: false, "href": $j(e).attr('data-href'), "width": "422px", "height": "435px", "iframe": true, "scrolling": false, "opacity": .6, "title": " " }).removeClass("invisible");
    		}
    		return true;
    	}
    	else {
    		$j(e).parent().parent().find('.active').removeClass('active'); $j('.call-box').hide();
    		$j('.chat-box').removeClass("in").animate({ duration: 70, queue: false });
		    $j('.ihnc-box').addClass("in").animate({ duration: 200, queue: false });
		    $j(this).addClass('active');
    		return false;
    	}
    }
    function ChatNowClick(e) {
    	if ($j('.contact-item').parent().hasClass('list-view')) {
    		if ($j(e).attr('data-href')) {
			    $j.colorbox({ "open": true, closeButton: false, "href": $j(e).attr('data-href'), "width": "422px", "height": "435px", "iframe": true, "scrolling": false, "opacity": .6, "title": " " }).removeClass("invisible");
		    }
    		return true;
    	}
    	else {
    		if ($j(e).attr('href')) {
    			return true;
    		}
    		else {
    			$j(e).parent().parent().find('.active').removeClass('active'); $j('.call-box').hide();
    			$j('.ihnc-box').removeClass("in").animate( { duration: 70, queue: false });
    			$j('.chat-box').addClass("in").animate({ duration: 200, queue: false });
			    $j(this).addClass('active');
    			return false;
    		}
    	}
    }
    function LetUsCallYouClick(e) {
    	if ($j('.contact-item').parent().hasClass('grid-view')) {
    		$j(this).parent().parent().find('.active').removeClass('active');
    		$j('.ihnc-box').removeClass("in").animate( { duration: 70, queue: false });
    		$j('.chat-box').removeClass("in").animate({ duration: 70, queue: false });
    		$j('.call-box').addClass("in").animate({ duration: 200, queue: false });
		    $j(this).addClass('active');
    		return false;
    	}
    	else {
    		return true;
    	}
    }
    function CallMeClick(e) {
    	if (e) {
    		if ($j(e).parent().prop("tagName") == "P") {
    			LP_Phone_Number = $j(e).parent().parent().find("[name='lpcttPhoneNumber1']").val();
