			<script type="text/javascript">var furnitureFloorPlanHasBeenShown = false;
	var flCntSlider = 0;
	var furflCntSlider = 0;
	//var cntSlider = 1;
    $j(document).ready(function () {
    	jQuery('.floor-toggle').on('click', function (element) {
            jQuery('.floor-toggle').removeClass('selected');
            jQuery(element.currentTarget).addClass('selected');
            jQuery('.floorplan-imgs').hide();
            if (jQuery(element.currentTarget).text() == 'With furniture') {
                if (!furnitureFloorPlanHasBeenShown) {
                    InitFlexSlider(false);
                    furnitureFloorPlanHasBeenShown = true;
                }
                jQuery(".floor-plan-name").hide();
                jQuery(".fur-floor-plan-name:eq(" + flCntSlider + ")").show();
                jQuery('#furniture-floorplans').show();
            }
            else {
            	jQuery(".fur-floor-plan-name").hide();
            	jQuery(".floor-plan-name:eq(" + flCntSlider + ")").show();
                jQuery('#floorplans').show();
            }

            return false;
        });

        jQuery('.floorPlanToggle').on('change', function (element) {
            jQuery('.floorplan-imgs').hide();
            if (jQuery('#selType').val() == 'Furniture') {
                if (!furnitureFloorPlanHasBeenShown) {
                    InitFlexSlider(false);
                    furnitureFloorPlanHasBeenShown = true;
                }
                jQuery(".floor-plan-name").hide();
                jQuery(".fur-floor-plan-name:eq(" + furflCntSlider + ")").show();
                jQuery('#furniture-floorplans').show();
            }
            else {
            	jQuery(".fur-floor-plan-name").hide();
            	jQuery(".floor-plan-name:eq(" + furflCntSlider + ")").show();
                jQuery('#floorplans').show();
            }

            return false;
        });
        
        //alert(cntSlider);
        if (haveFloorPlans) {
        	InitFlexSlider(true);
        	//$j('#floorplans').flexslider(cntSlider);
        }
        else {
        	InitFlexSlider(false);
        	//$j('#furniture-floorplans').flexslider(cntSlider);
        }

        

    });
   
    function InitFlexSlider(floorPlan) {
    	if (floorPlan) {
            jQuery('#floorplans').show();
            jQuery('#floorplans').flexslider({
                animation: "slide",
                slideshow: false,
                touch: false,
                start: function (slider) {
                    jQuery('#floorplans').append('<p id="pageFloorplans" class="pagination"></p>');
                    jQuery("#pageFloorplans").text(slider.currentSlide + 1 + ' of ' + slider.count);
                    jQuery(".fur-floor-plan-name").hide();
                    jQuery(".floor-plan-name").hide();
                    jQuery(".floor-plan-name:eq(" + slider.currentSlide + ")").show();
	                flCntSlider = slider.currentSlide;
                    if (slider.count > 1)
                    {
                        $j('#floorplans > .flex-direction-nav').show();
                    }
                },
                before: function (slider) {
                	jQuery("#pageFloorplans").text(slider.animatingTo + 1 + ' of ' + slider.count);
                	jQuery(".fur-floor-plan-name").hide();
                	jQuery(".floor-plan-name").hide();
                	jQuery(".floor-plan-name:eq(" + slider.animatingTo + ")").show();
                	flCntSlider = slider.animatingTo;
                	cntSlider = slider.animatingTo;
                }
            });
        }
        else {
            jQuery('#furniture-floorplans').show();
            jQuery('#furniture-floorplans').flexslider({
                animation: "slide",
                slideshow: false,
                touch: false,
                start: function (slider) {
                    jQuery('#furniture-floorplans').append('<p id="pageFurnitureFloorplans" class="pagination"></p>');
                    jQuery("#pageFurnitureFloorplans").text(slider.currentSlide + 1 + ' of ' + slider.count);
                    jQuery(".floor-plan-name").hide();
                    jQuery(".fur-floor-plan-name").hide();
                    jQuery(".fur-floor-plan-name:eq(" + slider.currentSlide + ")").show();
	                furflCntSlider = slider.currentSlide;
                    if (slider.count > 1) {
                        $j('#furniture-floorplans > .flex-direction-nav').show();
                    }
                },
                before: function (slider) {
                	jQuery("#pageFurnitureFloorplans").text(slider.animatingTo + 1 + ' of ' + slider.count);
                	jQuery(".floor-plan-name").hide();
                    jQuery(".fur-floor-plan-name").hide();
                    jQuery(".fur-floor-plan-name:eq(" + slider.animatingTo + ")").show();
                    furflCntSlider = slider.animatingTo;
                    cntSlider = slider.animatingTo;
                   
                }
            });
        }
    }
</script>
